import React, { Suspense }from 'react'
import '../../App.css'
const  ContactBtn = React.lazy(() => import('../ContactBtn'));
const HeroSection = React.lazy(() => import('../HeroSection'));

function Home() {
    return (
        <div>
            <Suspense fallback={<div>Wczytywanie...</div>}>
                <ContactBtn/>
                <HeroSection/>
            </Suspense>
        </div>
    )
}

export default Home
